import React, { useState, useEffect } from 'react';
import { useHistory, useParams } from 'react-router-dom';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';
import './GrowthChartPage.css';

// Mock data - In a real app, this would come from the server
const mockGrowthData = [
    { date: '۱۳۹۸/۰۲', height: 75, weight: 9.5 },
    { date: '۱۳۹۸/۰۸', height: 82, weight: 10.8 },
    { date: '۱۳۹۹/۰۲', height: 88, weight: 12.1 },
    { date: '۱۳۹۹/۰۸', height: 94, weight: 13.5 },
    { date: '۱۴۰۰/۰۲', height: 100, weight: 15.0 },
];

const GrowthChartPage = () => {
    const history = useHistory();
    const { childId } = useParams();
    const [childName, setChildName] = useState('');

    useEffect(() => {
        // In a real app, you would fetch the child's name using the childId
        setChildName(`کودک نمونه (ID: ${childId})`);
    }, [childId]);

    return (
        <div className="growth-chart-page">
            <nav className="page-nav-final">
                <button onClick={() => history.push('/my-children')} className="back-btn-growth">&larr; بازگشت</button>
                <h1>پرونده رشد: {childName}</h1>
                <div className="nav-placeholder"></div>
            </nav>

            <div className="growth-content-container">
                <div className="chart-card">
                    <h2>نمودار رشد قد (سانتی‌متر)</h2>
                    <ResponsiveContainer width="100%" height={300}>
                        <LineChart data={mockGrowthData}>
                            <CartesianGrid strokeDasharray="3 3" />
                            <XAxis dataKey="date" />
                            <YAxis />
                            <Tooltip />
                            <Legend />
                            <Line type="monotone" dataKey="height" stroke="#8884d8" name="قد" activeDot={{ r: 8 }} />
                        </LineChart>
                    </ResponsiveContainer>
                </div>

                <div className="chart-card">
                    <h2>نمودار رشد وزن (کیلوگرم)</h2>
                    <ResponsiveContainer width="100%" height={300}>
                        <LineChart data={mockGrowthData}>
                            <CartesianGrid strokeDasharray="3 3" />
                            <XAxis dataKey="date" />
                            <YAxis />
                            <Tooltip />
                            <Legend />
                            <Line type="monotone" dataKey="weight" stroke="#82ca9d" name="وزن" activeDot={{ r: 8 }} />
                        </LineChart>
                    </ResponsiveContainer>
                </div>

                <div className="add-data-card">
                    <h2>ثبت اطلاعات جدید</h2>
                    <form className="growth-form">
                        <div className="form-group"><label>تاریخ</label><input type="text" placeholder="مثال: ۱۴۰۱/۰۵/۱۰" /></div>
                        <div className="form-group"><label>قد (سانتی‌متر)</label><input type="number" /></div>
                        <div className="form-group"><label>وزن (کیلوگرم)</label><input type="number" step="0.1" /></div>
                        <button type="submit" className="btn-save">ثبت</button>
                    </form>
                </div>
            </div>
        </div>
    );
};

export default GrowthChartPage;
